编写一个程序，输入一个整数，输出该整数的绝对值。

```
#include <stdio.h>
int main()
{
    int n;
    scanf("%d", &n);
    if (n < 0)
        n = -n;
    printf("%d\n", n);
    return 0;
}
```

输入：

```
-123
```

输出：

```
123
